import React, { Component } from 'react';
 
class Name extends Component{
  constructor(){
    super();
    this.state={
      message:"this is only state"
    }
  }

  changeMessage(){
    this.setState({
      message:"this is setstate"
    })
  }
 render(){
  return(
    <div>
    <h1>{this.state.message}</h1>
    <button onClick={()=> this.changeMessage()}>Click to change the output</button>
    </div>
  )
 
  }
}
export default Name
